import "./dashboard.css"
import logo from "./images/logo.svg"
import './horizontalNav.css'
import {FaHistory} from 'react-icons/fa'
import {AiFillPushpin, AiFillHome, AiFillWechat} from 'react-icons/ai'
import {CgProfile} from 'react-icons/cg'
import { Link, withRouter } from "react-router-dom"
import { React, Component } from "react"

class HorizontalNav extends Component{

    handleLogout = (event) => {
        event.preventDefault();

        const requestOptions = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' }
        };
        fetch('/Titsuite-1.0-SNAPSHOT/api/users/logout', requestOptions).then(res => res.json()).then((data) => {
            console.log(data);
            this.props.logout(); // This is the problem.
            this.props.history.push('/login'); // This one too
        });

    }

    render(){
        return(
        <div>
            <ul class="nav flex-column Nav">
                        <li>
                            <img src={logo} class="img-fluid" alt="Logo" />
                        </li>

                            {(localStorage.getItem('role') === 'freelancer') ? 
                            <Link to="/dashboard" ><li class="nav-item item"><AiFillHome /> Dashboard</li></Link>
                             : <Link to="/customer/dashboard" ><li class="nav-item item"><AiFillHome/> Dashboard</li></Link>}
                        
                        
                            <Link to="/annonces" ><li class="nav-item item"> <AiFillPushpin /> Annonces</li></Link>
                        
                        <li class="nav-item item"> 
                            <AiFillWechat /> Service Client
                        </li>

                        
                        {(localStorage.getItem('role') === 'freelancer') ? 
                             <Link to="/portfeuille" > <li class="nav-item item"><FaHistory /> Portfeuille</li> </Link>
                             : <Link to="/customer/historique" ><li class="nav-item item"><FaHistory /> Historique</li></Link>}
                            
                        
                        
                        {(localStorage.getItem('role') === 'freelancer') ? 
                            <Link to="/freelancer/profile" ><li class="nav-item item"><CgProfile /> Profile</li> </Link>
                             : <Link to="/customer/profile" > <li class="nav-item item"><CgProfile /> Profile</li> </Link>}
                            
                        
                        <div class="row BottomNav">
                           
                            {(localStorage.getItem('role') === 'freelancer') ? 
                            <Link to="/freelancer/profile" > <li class="nav-item col">Hamid Aarif</li> </Link>
                             : <Link to="/customer/profile" > <li class="nav-item col">Hamid Aarif</li></Link>}
                    
                            
                            <li class="nav-item item">
                                <button onClick={this.handleLogout} className="btn btn-danger logoutButton col">Logout</button>
                            </li>
                        </div>
                    </ul>
        </div>
    )
    }
    
}

export default withRouter(HorizontalNav)
